import React, { useState, useEffect } from 'react';

function PropertyListing() {
  // State to store property listings
    const [listings, setListings] = useState([]);

  // useEffect to fetch property listings when the component mounts
  useEffect(() => {
    // Make a fetch request to your backend API to retrieve property listings
    fetch('/api/listings') // Replace with your actual API endpoint
      .then((response) => response.json())
      .then((data) => {
        // Update the listings state with the fetched data
        setListings(data);
      })
      .catch((error) => {
        console.error('Error fetching property listings:', error);
      });
  }, []);

  return (
    <div>
      <h1>Property Listings</h1>
      <ul>
        {listings.map((listing) => (
          <li key={listing.id}>
            <img src={listing.image_url} alt={listing.title} />
            <h2>{listing.title}</h2>
            <p>{listing.description}</p>
            <p>Location: {listing.city}, {listing.state} {listing.zip_code}</p>
            <p>Price: ${listing.price} per night</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PropertyListing;
